import "./products.scss";

const Products = () => {
  return <div className="products">
    <div className="left">
      <div className="filterItem">
        <h2>Product Categories</h2>
      </div>
      <div className="filterItem">
        <h2>Filter By Price</h2>
      </div>
    </div>
    <div className="right"></div>
  </div>;
};

export default Products;
